import React, { useState, useEffect } from 'react';
import './App.css';
import axios from "axios";

import Table from "./components/Table"

const App = () => {
  useEffect(() => {
    axios.get("http://localhost:8080/")
        .then(data => {
            console.log(data)
        }).catch(err => console.log(err));
  }, [])
  return (
    <div className="App">
      <Table />
    </div>
  );
}

export default App;
